  input: TEXT,F3A,,"In response to your letter dated March 6 please note that we have
    corrected the election designation for the 8/3/06 contribution from Mr. Faircloth
    and the 8/3/06 contribution from Mr. McConathy to reflect that they were for the
    General election.  The 12/10/04 contribution from Alex T. Hunt, III was for 2004
    General Debt Retirement.  It was reported correctly on the January 31, 2005 Year
    End report so there is no excessive contribution for the 2006 cycle from Mr. Hunt,
    III.  Also, we have corrected the election cycle date range to correct the column
    B figures.  Finally, please note that this letter had no response date included.  Campaign
    staff did not forward the letter to the Treasurer until last night.  We hope that
    this response is within the allowed time to respond.  Thank you."
